import { Navigate} from 'react-router-dom'
import Dlzc from '../pages/dlzc'
const routes = [
    {
        path: '/dlzc',
        element: <Dlzc />,
        children:[ {
            path: 'formm',
            element: <Formm />
        },
        {
            path: 'no',
            element: <No />
        },]
    },
    {
        path: '/white',
        element: <White />
    },
    {
        path: '/',
        element: <Navigate to='/home' />
    }
]
export default routes
